import React ,{Component} from 'react';
import logo from './logo.svg';
import './App.css';

class App extends Component {
    render(){
        return (
            <nav class="navbar navbar-inverse">
                <div class="container-fluid">
                    <a class="navbar-brand" >Title</a>
                </div>
            </nav>
        );
    }
}

export default App;
